--EG_DEMAND_REASON_MASTER

---insert eg_demand_reason


































--for 2010-11 1st half

INSERT
INTO EG_DEMAND_REASON
  (
    ID,
    ID_DEMAND_REASON_MASTER,
    ID_INSTALLMENT,
    PERCENTAGE_BASIS,
    ID_BASE_REASON,
    CREATE_TIMESTAMP,
    LAST_UPDATED_TIMESTAMP,
    PURPOSEID
  )
    SELECT SEQ_EG_DEMAND_REASON.NEXTVAL,
    ID_DEMAND_REASON_MASTER,
    (SELECT id_installment
    FROM eg_installment_master
    WHERE START_DATE LIKE to_date('04/01/2010','MM/DD/YYYY')
    AND ID_MODULE IN
      (SELECT ID_MODULE FROM EG_MODULE WHERE MODULE_NAME = 'Property Tax'
      )
    ),
    NULL,
    NULL,
    SYSDATE,
    SYSDATE,
    purposeid
    FROM EG_DEMAND_REASON 
    WHERE id_installment = (SELECT id_installment
    FROM eg_installment_master
    WHERE START_DATE LIKE to_date('10/01/2009','MM/DD/YYYY')
    AND ID_MODULE IN
      (SELECT ID_MODULE FROM EG_MODULE WHERE MODULE_NAME = 'Property Tax'
      )
    );

